Patch Set 1: Code-Review+1

@Vanessa: We should enable the image auto-update job for FD.io, so that newer images whenever built will push a change onto FD.io Gerrit and committers can self-service new images updates/upgrades by merging them. This is available in global-jjb templates.

https://github.com/lfit/releng-global-jjb/blob/master/jjb/lf-ci-jobs.yaml#L1885-L2061
